import React from "react";
import { Section, Container, Row, Column, TextWrapper, TopLine, Heading, Subtitle, ImgWrapper, Img, Button } from "../../styles";

function Benefits() {
    return (
        <Section lightBg={false}>
            <Container>
                <Row imgStart={false}>
                    <Column>
                        <TextWrapper>
                            <TopLine lightTopLine={true}>Benefits</TopLine>
                            <Heading lightText={true}>Our Solution Is Completely Safe!</Heading>
                            <Subtitle lightTextDesc={true}>We using IP</Subtitle>
                        </TextWrapper>
                    </Column>

                    <Column>
                        <ImgWrapper start={false}>
                            <Img src={require("../../images/Explanation.jpg")} alt={""} />
                        </ImgWrapper>
                    </Column>
                </Row>
            </Container>
        </Section>
    );
}

export default Benefits;
